import React from 'react';
import Login from '../components/LoginForm'

import diskJockey from '../images/onesandtwos.jpg'

const styles = {
    Center: {
      textAlign: 'center',
      justifyContent: 'center',
      alignItems: 'center'
    },
  }

function Test() {
    return(
        <div style={styles.Center}>
            <img src={diskJockey} alt="dj"/>
            THIS IS A TEST
            <Login/>
        </div>
    )

}

export default Test;
